var title_f18_40_19073="Management of a large parapneumonic effusion in children";
var content_f18_40_19073=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76277&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76277&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 582px\">",
"   <div class=\"ttl\">",
"    Approach to the management of pneumonia with a moderate or large parapneumonic effusion in children",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 562px; height: 683px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Black font: pathways used at Texas Children's Hospital.",
"    <sup>",
"     [1]",
"     <br/>",
"    </sup>",
"    <font class=\"blue\">",
"     Blue font",
"    </font>",
"    : additional options suggested by the American Pediatric Surgical Association, 2009.",
"    <sup>",
"     [2]",
"    </sup>",
"    <br>",
"     <font class=\"red\">",
"      Red font",
"     </font>",
"     : additional diagnostic pathway used by Grewal and colleagues, 1999.",
"     <sup>",
"      [3]",
"     </sup>",
"     <div class=\"footnotes\">",
"      CT: computerized tomography; VATS: video-assisted thorascopic surgery.",
"      <br>",
"       * No thoracentesis or drainage is needed if the patient has already been on antibiotics, is in no respiratory distress, and the effusion is small. A small effusion is defined as &lt;10mm on a lateral decubitus radiograph, or one that opacifies less than one fourth of the hemithorax.",
"       <sup>",
"        [4]",
"       </sup>",
"       <br>",
"        <font class=\"bullet\">",
"         &bull;",
"        </font>",
"        Whenever thoracentesis or drainage is performed, the fluid should be cultured and IV antibiotics started; the choice of antibiotics should be reevaluated depending on culture results.",
"        <br>",
"         &Delta; Fluid has frank pus, positive gram stain, pH&lt;7, LDH&gt;1000 IU/dL or glucose &lt;40 mg/dL.",
"         <br>",
"          <font class=\"lozenge\">",
"           &loz;",
"          </font>",
"          Choice between VATS and fibrinolytic therapy depends on the expertise and preference of the available clinicians.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </div>",
"     <div class=\"reference\">",
"      References:",
"      <ol>",
"       <li>",
"        Courtesy of Dr. Khoulood Fakhoury&nbsp;",
"       </li>",
"       <li>",
"        Kokoska ER, Chen MK, New Technology Committee. Position paper on video-assisted thoracoscopic surgery as treatment of pediatric empyema. J Pediatr Surg 2009; 44:289.",
"       </li>",
"       <li>",
"        Grewal H, Jackson RJ, Wagner CW, Smith SD. Early video-assisted thoracic surgery in the management of empyema. Pediatrics 1999; 103:e63.",
"       </li>",
"       <li>",
"        Bradley JS, Byington CL, Shah SS, et al. The management of community-acquired pneumonia in infants and children older than 3 months of age: clinical practice guidelines by the Pediatric Infectious Diseases Society and the Infectious Diseases Society of America. Clin Infect Dis 2011; 53:e25.",
"       </li>",
"      </ol>",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
