"    <div id=\"topicTitle\">",
"     Patient information: Sick sinus syndrome (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/sick-sinus-syndrome-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H26979952\">",
"      <span class=\"h1\">",
"       What is sick sinus syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sick sinus syndrome is a heart condition that can cause dizziness, chest pain, and fainting. Sick sinus syndrome is caused by a problem with the heart&rsquo;s electrical system.",
"     </p>",
"     <p>",
"      Normal heartbeats happen when an electrical signal starts in one spot near the top of the heart. This signal follows a path to spread across the heart. As it spreads, the signal makes the heart muscle squeeze. Each time the heart squeezes (&ldquo;beats&rdquo;), it pumps blood all over the body. Normally, the heart beats in a regular way 60 to 100 times a minute.",
"     </p>",
"     <p>",
"      In sick sinus syndrome, there is a problem with the spot that starts the heartbeat. Heartbeats don&rsquo;t start often enough. As a result, the heartbeat is slower than normal. Doctors use the term &ldquo;bradycardia&rdquo; when a heartbeat is slower than normal.",
"     </p>",
"     <p>",
"      Some people with sick sinus syndrome also have episodes when their heartbeat is too fast, called &ldquo;tachycardia.&rdquo;",
"     </p>",
"     <p>",
"      People with sick sinus syndrome can have episodes in which a fast heartbeat quickly changes to a slow heartbeat. Because of this, doctors sometimes use the terms &ldquo;tachycardia-bradycardia syndrome&rdquo; or &ldquo;tachy-brady syndrome&rdquo; to describe sick sinus syndrome.",
"     </p>",
"     <p>",
"      Different things can cause sick sinus syndrome, including heart conditions, other medical problems, and certain medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26979967\">",
"      <span class=\"h1\">",
"       What are the symptoms of sick sinus syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people with sick sinus syndrome have no symptoms.",
"     </p>",
"     <p>",
"      When symptoms do happen, they can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling light-headed or dizzy",
"       </li>",
"       <li>",
"        Fainting or feeling like you are going to faint",
"       </li>",
"       <li>",
"        Trouble breathing, especially with exercise",
"       </li>",
"       <li>",
"        Chest pain, especially with exercise or when under stress",
"       </li>",
"       <li>",
"        Feeling like your heart is beating fast, beating hard, or skipping beats",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26979982\">",
"      <span class=\"h1\">",
"       Is there a test for sick sinus syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms and do an exam. During the exam, he or she will check your pulse and listen to your heart. He or she will do an ECG (also called &ldquo;electrocardiogram&rdquo; or &ldquo;EKG&rdquo;). An ECG measures the electrical activity in your heart (",
"      <a class=\"graphic graphic_figure graphicRef53145 \" href=\"UTD.htm?6/63/7154\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Your doctor might also do other tests. These can help show what&rsquo;s causing the sick sinus syndrome and check for other problems with your heart. These tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A home heart monitor &ndash; This test records your heartbeat over the course of hours or days. You will need to wear or carry a heart monitor device around at home (",
"        <a class=\"graphic graphic_figure graphicRef76605 \" href=\"UTD.htm?38/7/39039\">",
"         figure 2",
"        </a>",
"        ). The device will measure and record your heart&rsquo;s electrical activity.",
"       </li>",
"       <li>",
"        An exercise stress test &ndash; During this test, the doctor will record your ECG while you exercise on a treadmill or bike (",
"        <a class=\"graphic graphic_figure graphicRef60855 \" href=\"UTD.htm?31/21/32085\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26980060\">",
"      <span class=\"h1\">",
"       How is sick sinus syndrome treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on whether you have symptoms or not, and what&rsquo;s causing your sick sinus syndrome.",
"     </p>",
"     <p>",
"      People who have no symptoms usually do not need treatment. But your doctor or nurse will see you for regular follow-ups to monitor your condition.",
"     </p>",
"     <p>",
"      People who have symptoms usually need treatment. Treatment can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicine changes &ndash; If a medicine is causing your sick sinus syndrome, the doctor will change or stop that medicine.",
"       </li>",
"       <li>",
"        A pacemaker &ndash; This is the treatment used most often for sick sinus syndrome. A pacemaker is a device that sits under the skin near a person&rsquo;s heart. It sends electrical signals to the heart. These signals help the heart beat at a normal rate.",
"       </li>",
"       <li>",
"        Medicines &ndash; Doctors sometimes treat sick sinus syndrome with heart medicines, but these don&rsquo;t usually work as well as a pacemaker.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26980075\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
